  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Agassiz NWR outlines
  Refuge accomplishments during the 1976 calendar year. The report begins with an
  introduction to the Refuge and information about weather conditions, habitat conditions,
  land acquisition activities, and the system status. Construction and maintenance
  are also described. Habitat management is covered; croplands, grasslands, wetlands,
  and forests are discussed. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, and mammals. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreation,
  and law enforcement. Cooperative programs and safety information are attached.\",\n\t\"license_title\":
